class myclasss:
    def method1(self,a):
        print("1 method ")
        print("a value:a",a)
    def method1(self,a,b,c):
        print("2 method ")
        print("a value:",a)
        print("b value:b",b)
        print("c value:c",c)
        
    def method1(self,a,b):
        print("3 method ")
        print("a value:a",a)
        print("b value:b",b)

m1=myclasss()
m1.method1(1)
